INSERT INTO `ke_article` VALUES ('9', '3', '会员制度', '<p style=\"margin-top: 5px; text-align: left; text-indent: 0em; line-height: normal;\">一、银卡会员：累计在平台消费300元自动升级为银卡会员，银卡会员享受全部商品98折购买，获得全额积分。</p><p style=\"text-align: left; text-indent: 0em; line-height: normal;\">二、金卡会员：累计在平台消费800元自动升级为金卡会员，金卡会员享受全部商品95折购买，获得全额积分。</p><p style=\"text-align: left; text-indent: 0em; line-height: normal;\">三、黑卡会员：需要充值升级成为黑卡会员，黑卡会员享受全部商品9折购买，获得全额积分。</p><p><br/></p>', '1567506311', '1', '50');
INSERT INTO `ke_article` VALUES ('10', '3', '积分制度', '<p>一、积分如何获得</p><p>1、邀请他人成为会员可以获得xx积分。</p><p>2、在平台购买产品确认收货后可以获得相应的积分。如果申请退款将不能获得积分。</p><p>二、如何使用积分</p><p>积分可以在积分页面兑换成宠物。</p><p><br/></p>', '1567506832', '1', '50');
INSERT INTO `ke_article` VALUES ('11', '3', '宠物制度', '<p>一、宠物需要使用积分兑换。</p><p>二、每种宠物只能同时兑换一只，在宠物存活时间过后可以再次兑换。</p><p>三、宠物的存活时间为720小时，每24小时可以领取一次钱币，需要更高积分兑换的宠物可以领取更多的钱币。</p>', '1567506968', '1', '50');
