
-- -----------------------------
-- Table structure for `ke_account_log`
-- -----------------------------
DROP TABLE IF EXISTS `ke_account_log`;
CREATE TABLE `ke_account_log` (
  `log_id` int(10) NOT NULL AUTO_INCREMENT,
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '会员ID',
  `relative_id` int(10) DEFAULT '0' COMMENT '相关ID 订单 推荐人ID等',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '变动金额',
  `all_money` decimal(10,2) DEFAULT '0.00' COMMENT '总金额',
  `jifen` int(10) DEFAULT '0' COMMENT '变动积分',
  `all_jifen` int(10) DEFAULT '0' COMMENT '总积分',
  `jinbi` int(10) DEFAULT '0' COMMENT '变动金币',
  `all_jinbi` int(10) DEFAULT '0' COMMENT '总金币',
  `change_time` int(10) DEFAULT '0',
  `change_desc` varchar(100) DEFAULT NULL COMMENT '变动类型',
  `change_type` tinyint(2) DEFAULT '0' COMMENT '0后台调节 1积分兑换 2宠物生产 3 邀请赠送积分 5金币资金兑换 6提现 7拼团订单退款 8普通订单退款 9普通订单返积分',
  PRIMARY KEY (`log_id`)
) ENGINE=InnoDB AUTO_INCREMENT=562 DEFAULT CHARSET=utf8;

