  `goods_id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) DEFAULT '0' COMMENT '0 普通 1 0元购 2 团购',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `short_name` varchar(100) DEFAULT NULL COMMENT '商品短标题',
