  `shop_price` decimal(10,2) DEFAULT '0.00' COMMENT '现价',
  `goods_number` smallint(5) DEFAULT '0' COMMENT '商品数量',
  `is_shipping` tinyint(1) DEFAULT '0' COMMENT '1免运费 0收费',
  `add_time` int(10) DEFAULT '0' COMMENT '创建时间',
