-- Table structure for `ke_order_goods`
-- -----------------------------
DROP TABLE IF EXISTS `ke_order_goods`;
CREATE TABLE `ke_order_goods` (
  `rec_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '订单ID',
  `order_status` tinyint(1) DEFAULT '0' COMMENT '0正常 1申请退款 -1拒绝退款 2退款成功',
  `order_amount` decimal(10,2) DEFAULT NULL,
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '商品ID',
  `goods_name` varchar(120) NOT NULL DEFAULT '' COMMENT '商品名称',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '购买数量',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `shop_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '现价',
  `fan_price` decimal(10,2) DEFAULT '0.00',
  `goods_attr` text COMMENT '属性值',
  `goods_attr_id` varchar(255) DEFAULT '' COMMENT '属性ID',
  `add_time` int(10) DEFAULT '0' COMMENT '退款添加时间',
  `update_time` int(10) DEFAULT '0' COMMENT '处理时间',
  PRIMARY KEY (`rec_id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=InnoDB AUTO_INCREMENT=231 DEFAULT CHARSET=utf8;

