-- Records of `ke_order_goods`
-- -----------------------------

-- -----------------------------
-- Table structure for `ke_order_info`
-- -----------------------------
DROP TABLE IF EXISTS `ke_order_info`;
CREATE TABLE `ke_order_info` (
  `order_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `order_type` tinyint(1) DEFAULT '1' COMMENT '1 普通订单 2拼团订单',
  `tid` mediumint(5) DEFAULT '0' COMMENT '拼团ID',
  `order_sn` varchar(20) NOT NULL DEFAULT '' COMMENT '订单号',
  `user_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '会员ID',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1已提交 2 取消 3申请退款 9退款完成 10待成团 11已成团 12以失败',
  `shipping_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0 未发货 1已发货 2已收获',
  `pay_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0未支付 1已支付',
  `consignee` varchar(60) NOT NULL DEFAULT '' COMMENT '收货人信息',
  `province` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '省',
  `city` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '市',
  `district` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '县区',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '详细地址',
  `phone` varchar(60) NOT NULL DEFAULT '' COMMENT '手机号',
  `postscript` varchar(255) DEFAULT '' COMMENT '备注',
  `shipping_id` tinyint(3) NOT NULL DEFAULT '0' COMMENT '快递ID',
  `shipping_name` varchar(120) NOT NULL DEFAULT '' COMMENT '快递名称',
  `pay_id` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付ID 1支付宝 2微信',
  `pay_name` varchar(20) NOT NULL DEFAULT '' COMMENT '支付宝支付微信支付',
  `goods_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品金额',
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '物流费用',
  `money_paid` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已支付费用',
  `member_amount` decimal(10,2) DEFAULT '0.00',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总费用',
  `bonus_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '优惠券ID',
  `bonus` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券金额',
  `integral` int(10) DEFAULT '0' COMMENT '积分',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '添加时间',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间',
  `shipping_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发货时间',
  `confirm_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '确认收货时间',
  `mark` varchar(255) DEFAULT NULL COMMENT '申请退款原因',
  `invoice_no` varchar(50) DEFAULT NULL COMMENT '快递单号',
  `beizhu` varchar(255) DEFAULT NULL COMMENT '备注',
  `is_comment` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `user_id` (`user_id`),
  KEY `order_status` (`order_status`),
  KEY `shipping_status` (`shipping_status`),
  KEY `pay_status` (`pay_status`),
  KEY `shipping_id` (`shipping_id`),
  KEY `pay_id` (`pay_id`)
) ENGINE=InnoDB AUTO_INCREMENT=220 DEFAULT CHARSET=utf8;

-- -----------------------------
-- Records of `ke_order_info`
-- -----------------------------

